      function AfterPForm return boolean is
	l_menu VARCHAR2(25);
begin
SELECT TO_NUMBER(TO_CHAR(datdebex.moismens,'YYYY')), TO_CHAR(datdebex.moismens)
	INTO :P_ANNEE , :P_MOISMENS
	FROM datdebex;


		

	:P_NUMSEQ := pack_cout_standard_ke.insert_tmp_coutke_etats(:P_ANNEE,'',NULL,NULL,NULL,NULL, NULL, '00000000000');

	return (TRUE);
end;

      function AfterReport return boolean is
begin
  
  
  DELETE FROM TMP_COUTKE_ETATS WHERE NUMSEQ = :P_NUMSEQ ; 
  
  COMMIT ; 
  
  return (TRUE);
end;
